import React, { useState } from "react";
import "./App.css";
import StartPage from "./components/StartPage/StartPage";
import Table from "./components/StartPage/Table";

function App() {
   const [matrix, setMatrix] = useState([]);

   return (
      <div className="App">
         {matrix.length === 0 ? (
            <StartPage createMatrix={setMatrix} />
         ) : (
            <Table matrix={matrix} />
         )}
      </div>
   );
}

export default App;
